purchasobject:
Оказание телематических  услуг и услуг связи по передаче данных (услуги по доступу к информационно-коммуникационной сети  Интернет) для Министерства экономического развития и торговли Республики Адыгея в 2021году, 
1 подсеть - 5 Мбит/с с 4 статичными IP адресами; 
2 подсеть - 20 Мбит/с c 4 статичными IP адресами
Необходимые параметры качества:
бесперебойный круглосуточный доступ в публичную сеть Интернет;
безлимитный трафик (без учета трафика);
услуги обеспечения доступа к сети Интернет должны оказываться 24 часа в сутки, 7 дней в неделю, 365 дней в году (12 месяцев).
